import axios from "axios";

export const storeContent = async (chatData) => {
  console.log("chatData: ", chatData);
  const token = localStorage.getItem('token');
  console.log(token);
  try {
    const response = await axios.post(
      "http://localhost:3001/api/storechatdata",
      chatData,
      {
        headers: {
          "Content-Type": "application/json",
          "authtoken": token // Include the token in the request headers
        },
      }
    ); // send data to server
  } catch (error) {
    console.log("Error store data!", error);
    return { error: error.response?.data?.error || "Error store data!" };
  }
};
